import React from "react";
import { Provider } from "react-native-paper";
import App from "./src";
import { theme } from "./src/core/theme";
import { RegisterScreen } from "./src/screens";

const Main = () => (
  <Provider theme={theme}>
    <App />
  </Provider>
);

export default Main;
